'use strict';

var valid = [];
var test;

test = {
	'code': [
		'function sum( x ) {',
		'  var sum = 0;',
		'  for ( var i = 0; i < x.length; i++ ) {',
		'    sum += x[ i ];',
		'  }',
		'  return sum;',
		'}',
		'var arrSum = sum( [ 1, 2, 3, 4 ] );'
	].join( '\n' )
};
valid.push( test );

test = {
	'code': [
		'  var log = require( \'@stdlib/console/log\' );',
		'  log( {} );'
	].join( '\n' )
};
valid.push( test );

test = {
	'code': [
		'var arr = [ 1, 2, 3, 4, {} ];'
	].join( '\n' )
};
valid.push( test );

test = {
	'code': [
		'  var log = require( \'@stdlib/console/log\' );',
		'  log(',
		'    {',
		'      \'a\': 1',
		'    }',
		'  );'
	].join( '\n' )
};
valid.push( test );

test = {
	'code': [
		'  var log = require( \'@stdlib/console/log\' );',
		'  log(',
		'    [',
		'      1,',
		'      2',
		'    ]',
		'  );'
	].join( '\n' )
};
valid.push( test );

test = {
	'code': [
		'  var log = require( \'@stdlib/console/log\' );',
		'  log(',
		'    [',
		'      {',
		'        \'a\': 1',
		'      }',
		'    ]',
		'  );'
	].join( '\n' )
};
valid.push( test );

test = {
	'code': [
		'  var arr = [',
		'  {',
		'    \'a\': 1',
		'  }',
		'];'
	].join( '\n' )
};
valid.push( test );

test = {
	'code': [
		'  var x = array( [] );'
	].join( '\n' )
};
valid.push( test );

test = {
	'code': [
		'  var x = array( [ {} ] );'
	].join( '\n' )
};
valid.push( test );

test = {
	'code': [
		'  var x = new Float64Array( [ 1, 2, 3, 4 ] );'
	].join( '\n' )
};
valid.push( test );

test = {
	'code': [
		'  var x = new Float64Array(',
		'    [',
		'      1,',
		'      2,',
		'      3,',
		'      4',
		'    ]',
		'  );'
	].join( '\n' )
};
valid.push( test );


// EXPORTS //

module.exports = valid;
